Great British Railway Journeys Series 3

Travel Documentary hosted by Michael Portillo, published by BBC in 2012 - English narration


Information
------------------------------

Great British Railway Journeys Series 3
Michael Portillo takes to the tracks with a copy of George Bradshaw's Victorian Railway Guidebook. In a series of five epic journeys, Portillo travels the length and breadth of the country to see how the railways changed us, and what of Bradshaw's Britain remains.






4)  Epping to Hackney 
Michael visits Essex to discover why dairy herds travelled there by rail from all over the country in the nineteenth century. He also visits Waltham Cross to see how the gunpowder made there fuelled the building of an empire, and heads to Hackney to uncover the gruesome details of the first murder on a train.


